import Home from './App.js';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>
    <Routes>
      <Route path='/' element = {<Home/>}></Route>
      Route
    </Routes>
    <div className='container'>
    <Left></Left>
    <Right></Right>
    </div>
    </>
  );
}

export default App;
